// draw either a block or a chess
void drawImage(const int16_t x, const int16_t y, const int16_t width, const int16_t height, const uint8_t *image) {
    uint8_t color;

    for (int j=0; j<height; j++) {
        for (int i=0; i<width; i++) {
            color = image[j*width+i];
            if (color!=BLACK) drawPixel(x+i, y+j, color);
        }
    }

}

// clear either a block or a chess
void clearImage(const int16_t x, const int16_t y, const int16_t width, const int16_t height, const uint8_t *image) {
    uint8_t color;

    for (int j=0; j<height; j++) {
        for (int i=0; i<width; i++) {
            color = image[j*width+i];
            if (color!=BLACK) drawPixel(x+i, y+j, BLACK);
        }
    }

}

// clear a region
void clearRegion(const int16_t x, const int16_t y, const int16_t width, const int16_t height) {
    for (int i=0; i<width; i++) {
        for (int j=0; j<height; j++) {
            drawPixel(x+i, y+j, BLACK);
        }
    }

}

// clear the entire screen
void clearScreen() {
    memset(vga_data_array, BLACK, TXCOUNT);

}

// clear image1 and draw image2 at topleft (x,y)
void clearAndDraw(const int16_t x, const int16_t y, const int16_t width, const int16_t height, const uint8_t *image1, const uint8_t *image2) {
    uint8_t color1;
    uint8_t color2;

    for (int j=0; j<height; j++) {
        for (int i=0; i<width; i++) {
            color1 = image1[j*width+i];
            color2 = image2[j*width+i];
            if (color1!=color2) drawPixel(x+i, y+j, color2);
        }
    }

}

// get the current pixel color on screen
uint8_t getPixelColor(short x, short y) {
    if (x > 639) x = 639;
    if (x < 0) x = 0;
    if (y < 0) y = 0;
    if (y > 479) y = 479;

    int pixel = ((640 * y) + x);

    if (pixel & 1) return (vga_data_array[pixel>>1] & 0b11110000) >> 4;
    else return (vga_data_array[pixel>>1] & 0b00001111);

}


// fill a small rectangle image in a larger rectangle
void fillColor(const int16_t x1, const int16_t y1, const int16_t x2, const int16_t y2, const int16_t w1, const int16_t h1, const int16_t w2, const int16_t h2, const uint8_t *image) {
    uint8_t draw_color;
    uint8_t erase_color;

    for (int j=0; j<h1; j++) {
        for (int i=0; i<w1; i++) {
            if (x2<=x1+i && x1+i<x2+w2 && y2<=y1+j && y1+j<y2+h2) {
                // within the smaller rectangle
                draw_color = image[(y1+j-y2)*w2+(x1+i-x2)];
                erase_color = getPixelColor(x1+i, y1+j);
                if (draw_color!=erase_color) drawPixel(x1+i, y1+j, draw_color);
            } else {
                // not within the smaller rectangle
                if (getPixelColor(x1+i, y1+j)==WHITE || getPixelColor(x1+i, y1+j)==DARK_BLUE) drawPixel(x1+i, y1+j, BLACK);
            }
        }
    }

}

int16_t randomDistance(int16_t low, int16_t high) {
    if (low==high) return low;
    else return (rand()%(high-low+1)) + low;

}

// spawn a block based on the position of blocks[curr_block_index]
void spawnBlock() {
    if (num_blocks>=10) return;

    direction = (DIRECTION)(rand()%4);
    
    // distance in x axis
    int16_t difference = randomDistance(80, 270);

    if (direction == TOP_LEFT) {
        blocks[num_blocks].x = blocks[curr_block_index].x - difference;
        blocks[num_blocks].y = blocks[curr_block_index].y - 0.75*difference;
        if (blocks[num_blocks].y<=33) blocks[num_blocks].y=50;  // a full chess can be shown
    } else if (direction == TOP_RIGHT) {
        blocks[num_blocks].x = blocks[curr_block_index].x + difference;
        blocks[num_blocks].y = blocks[curr_block_index].y - 0.75*difference;
        if (blocks[num_blocks].y<=33) blocks[num_blocks].y=25;  // a full chess can be shown
    } else if (direction == BOTTOM_LEFT) {
        blocks[num_blocks].x = blocks[curr_block_index].x - difference;
        blocks[num_blocks].y = blocks[curr_block_index].y + 0.75*difference;
    } else if (direction == BOTTOM_RIGHT) {
        blocks[num_blocks].x = blocks[curr_block_index].x + difference;
        blocks[num_blocks].y = blocks[curr_block_index].y + 0.75*difference;
    }

    blocks[num_blocks].color = (BlockColor)(rand()%3);
    
    num_blocks++;

}

