// save the highest score to flash
void saveScore() {
    uint8_t buffer[FLASH_PAGE_SIZE];
    memset(buffer, 0xFF, FLASH_PAGE_SIZE);                              // set to all 1
    memcpy(buffer, &highest_score, sizeof(highest_score));              // copy score to the first 4 bytes

    uint32_t ints = save_and_disable_interrupts();
    flash_range_erase(FLASH_TARGET_OFFSET, FLASH_SECTOR_SIZE);          // erase 4KB
    flash_range_program(FLASH_TARGET_OFFSET, buffer, FLASH_PAGE_SIZE);  // write 256B
    restore_interrupts(ints);

}
